--------DECLARE @I_ProcesoID	int
--------SET @I_ProcesoID = (SELECT MAX(CAST(CUOTA_PAGO as int)) FROM  temporal_pagos..cp_des) + 1 

--------DBCC CHECKIDENT(TC_Proceso, RESEED, @I_ProcesoID)

