INSERT [dbo].[TC_ClasificadorPresupuestal] ([I_ClasificadorID], [C_TipoTransCod], [C_GenericaCod], [C_SubGeneCod], [C_EspecificaCod], [T_ClasificadorDesc], [T_ClasificadorDetalle], [B_Eliminado], [I_UsuarioCre], [D_FecCre], [I_UsuarioMod], [D_FecMod]) VALUES (578, N'1', N'4', N'14', N'13', N'CANON MINERO', N'SON LAS TRANSFERENCIAS POR EL CANON MINERO QUE CORRESPONDEN A LA PARTICIPACIÓN DE LA QUEZAN LOSBIERNOS LOCALES Y REGIONALES SOBRE LOS INGRESOS Y RENTAS OBTENIDOS POR EL ESTADO POR LA EXPLOTACIÓN DE RECURSOS MINERALES, METÁLICOS Y NO METÁLICOS.  ESTÁ CONSTITUIDO POR EL 50% DEL IMPUESTO A LA RENTA QUE OBTIENE EL ESTADO Y QUE PAGAN LOS TITULARES DE LA ACTIVIDAD MINERA POR EL APROVECHAMIENTO DE LOS RECURSOS MINERALES, METÁLICOS Y NO METÁLICOS. LA DISTRIBUCIÓN SE ENCUENTRA REGULADA POR LEY.', 0, 1, CAST(N'2021-07-12T10:48:37.510' AS DateTime), NULL, NULL)
INSERT [dbo].[TC_ClasificadorPresupuestal] ([I_ClasificadorID], [C_TipoTransCod], [C_GenericaCod], [C_SubGeneCod], [C_EspecificaCod], [T_ClasificadorDesc], [T_ClasificadorDetalle], [B_Eliminado], [I_UsuarioCre], [D_FecCre], [I_UsuarioMod], [D_FecMod]) VALUES (579, N'1', N'4', N'14', N'14', N'CANON GASIFERO', N'SON LAS TRANSFERENCIAS POR EL CANON GASÍFERO QUE CORRESPONDEN A LA PARTICIPACIÓN QUE PERCIBEN LAS CIRCUNSCRIPCIONES DONDE ESTÁ UBICADO GEOGRÁFICAMENTE EL RECURSO NATURAL SOBRE LOS INGRESOS QUE PERCIBE EL ESTADO POR LA EXPLOTACIÓN DE GAS NATURAL Y CONDENSADOS.  EL CANON GASÍFERO SE CONFORMA DEL 50% DEL IMPUESTO A LA RENTA, 50% DE LAS REGALÍAS Y 50% DE LA PARTICIPACIÓN DEL ESTADO EN LOS CONTRATOS DE SERVICIOS. ESTE ÚLTIMO CONCEPTO SE DEFINE COMO EL VALOR DE REALIZACIÓN O VENTA DESCONTADOS LOS COSTOS HASTA EL PUNTO DE MEDICIÓN DE LA PRODUCCIÓN EN LOS CONTRATOS DE SERVICIOS. LA DISTRIBUCIÓN SE ENCUENTRA REGULADA POR LEY.', 0, 1, CAST(N'2021-07-12T10:48:37.510' AS DateTime), NULL, NULL)
INSERT [dbo].[TC_ClasificadorPresupuestal] ([I_ClasificadorID], [C_TipoTransCod], [C_GenericaCod], [C_SubGeneCod], [C_EspecificaCod], [T_ClasificadorDesc], [T_ClasificadorDetalle], [B_Eliminado], [I_UsuarioCre], [D_FecCre], [I_UsuarioMod], [D_FecMod]) VALUES (580, N'1', N'4', N'14', N'15', N'CANON HIDROENERGETICO', N'SON LAS TRANSFERENCIAS POR EL CANON HIDROENERGÉTICO QUE CORRESPONDEN A LA PARTICIPACIÓN DE LA QUEZAN LOSBIERNOS REGIONALES Y LOCALES SOBRE LOS INGRESOS Y RENTAS OBTENIDOS POR EL ESTADO POR LA UTILIZACIÓN DEL RECURSO HÍDRICO EN LA GENERACIÓN DE ENERGÍA ELÉCTRICA. EL CANON HIDROENERGÉTICO SE CONFORMA DEL 50% DEL IMPUESTO A LA RENTA QUE PAGAN LAS EMPRESAS CONCESIONARIAS DE GENERACIÓN DE ENERGÍA ELÉCTRICA QUE UTILICEN EL RECURSO HÍDRICO. LA DISTRIBUCIÓN SE ENCUENTRA REGULADA POR LEY.', 0, 1, CAST(N'2021-07-12T10:48:37.510' AS DateTime), NULL, NULL)
INSERT [dbo].[TC_ClasificadorPresupuestal] ([I_ClasificadorID], [C_TipoTransCod], [C_GenericaCod], [C_SubGeneCod], [C_EspecificaCod], [T_ClasificadorDesc], [T_ClasificadorDetalle], [B_Eliminado], [I_UsuarioCre], [D_FecCre], [I_UsuarioMod], [D_FecMod]) VALUES (581, N'1', N'4', N'14', N'16', N'CANON PESQUERO', N'SON LAS TRANSFERENCIAS POR EL CANON PESQUERO POR LA PARTICIPACIÓN DE LA QUEZAN LOSBIERNOS LOCALES Y REGIONALES SOBRE LOS INGRESOS Y RENTAS OBTENIDOS POR EL ESTADO POR LA EXPLOTACIÓN DE LOS RECURSOS HIDROBIOLÓGICOS, DE LAS EMPRESAS DEDICADAS A LA EXTRACCIÓN COMERCIAL DE PESCA DE MAYOR ESCALA DE RECURSOS NATURALES HIDROBIOLÓGICOS DE AGUAS MARÍTIMAS Y CONTINENTALES LACUSTRES Y FLUVIALES, Y DE AQUELLAS EMPRESAS QUE ADEMÁS DE EXTRAER ESTOS RECURSOS SE ENCARGUEN DE SU PROCESAMIENTO. EL CANON PESQUERO ESTÁ CONSTITUIDO POR EL 50% DEL IMPUESTO A LA RENTA Y LOS DERECHOS DE PESCA PAGADO POR LAS EMPRESAS DEDICADAS A LA EXTRACCIÓN COMERCIAL DE PESCA DE MAYOR ESCALA, DE RECURSOS NATURALES HIDROBIOLÓGICOS DE AGUAS MARÍTIMAS, Y CONTINENTALES LACUSTRES Y FLUVIALES. ADICIONALMENTE, SE DEBE SEÑALAR QUE EL REGLAMENTO DE LA LEY DE CANON, ESTABLECE QUE EL MONTO DEL CANON PESQUERO PROVENIENTE DE LOS DERECHOS DE PESCA, SERÁ DETERMINADO SEMESTRALMENTE, EN VIRTUD DE LO DISPUESTO EN LOS ARTÍCULOS 41° Y 47° DEL REGLAMENTO DE LA LEY GENERAL DE PESCA. LA DISTRIBUCIÓN SE ENCUENTRA REGULADA POR LEY.', 0, 1, CAST(N'2021-07-12T10:48:37.510' AS DateTime), NULL, NULL)
